        config: {distribution: uniform, mode: fan_avg, scale: 1.0, seed: null}
      kernel_regularizer:
        class_name: L1L2
        config: {l1: 0.0, l2: 9.999999747378752e-06}
      name: Dense_0
      trainable: false
      units: 100
      use_bias: true
    inbound_nodes:
    - - - input
        - 0
        - 0
        - {}
    name: Dense_0
  - class_name: Dense
    config:
      activation: elu
