      use_bias: true
    inbound_nodes:
    - - - Dense_1
        - 0
        - 0
        - {}
    name: dense_1
  - class_name: Concatenate
    config: {axis: -1, name: concatenate_1, trainable: true}
    inbound_nodes:
    - - - input
        - 0
        - 0
        - &id001 {}
      - - Dense_0
        - 0
        - 0
        - *id001
      - - Dense_1
        - 0
        - 0
        - *id001
      - - dense_1
        - 0
        - 0
        - *id001
