      name: Dense_main_0
      trainable: true
      units: 100
      use_bias: true
    inbound_nodes:
    - - - concatenate_1
        - 0
        - 0
        - {}
    name: Dense_main_0
  - class_name: Dropout
    config: {name: dropout_3, noise_shape: null, rate: 0.3, seed: null, trainable: true}
    inbound_nodes:
